import React from 'react';
import { DropDown, DropDownItem, SearchStyles } from './styles/DropDown';

const Search = () => (
  <div>
    <SearchStyles>
      <div>
        <input type="search" />
      </div>
      <DropDown>
        <DropDownItem>Hello</DropDownItem>
        <DropDownItem>Hello</DropDownItem>
        <DropDownItem>Hello</DropDownItem>
      </DropDown>
    </SearchStyles>
  </div>
);

export default Search;
